import React from "react";
import ReactDOM from "react-dom";
import htmlImage from "./html.png";
import cssImage from "./css.png";
import jslImage from "./js.png";
import reactImage from "./react.png";

const header = (
  <header>
    <div className="header-wrapper">
      <h2> front End Technologies</h2>
    </div>
  </header>
);
const user = (
  <div>
    <img src={htmlImage} alt="html image" />
    <img src={cssImage} alt="css image" />
    <img src={jslImage} alt="js image" />
    <img src={reactImage} alt="react image" />
  </div>
);

function App() {
  return (
    <div>
      {/* Logo is an actual React component */}
      <htmlImage />
    </div>
  );
}

const app = (
  <div className="'app">
    {header}
    {App}
  </div>
);

const rootElement = document.getElementById("root");
ReactDOM.render(app, rootElement);
